;\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"474649","type":"CustomJS"},{"attributes":{"editor":{"id":"474817"},"field":"Avg. Drawdown Duration","formatter":{"id":"474816"},"title":"Avg. Drawdown Duration"},"id":"474763","type":"TableColumn"},{"attributes":{},"id":"474826","type":"StringFormatter"},{"attributes":{"editor":{"id":"474783"},"field":"End","formatter":{"id":"474782"},"title":"End"},"id":"474743","type":"TableColumn"},{"attributes":{},"id":"474838","type":"UnionRenderers"},{"attributes":{"below":[{"id":"474327"}],"center":[{"id":"474330"},{"id":"474334"},{"id":"474645"}],"height":400,"left":[{"id":"474331"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"474604"},{"id":"474611"},{"id":"474617"},{"id":"474623"},{"id":"474629"}],"sizing_mode":"stretch_width","title":{"id":"474631"},"toolbar":{"id":"474343"},"toolbar_location":null,"width":null,"x_range":{"id":"474318"},"x_scale":{"id":"474323"},"y_range":{"id":"474321"},"y_scale":{"id":"474325"}},"id":"474319","subtype":"Figure","type":"Plot"},{"attributes":{"editor":{"id":"474833"},"field":"Profit Factor","formatter":{"id":"474832"},"title":"Profit Factor"},"id":"474771","type":"TableColumn"},{"attributes":{"below":[{"id":"474367"}],"center":[{"id":"474370"},{"id":"474374"},{"id":"474428"}],"height":110,"left":[{"id":"474371"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers
